	function OnResizeWindow() {
		if (!canvas) {
			return;
		}

		// This maybe not a good idear, just do it for convenient.
		// See more at https://webglfundamentals.org/webgl/lessons/webgl-anti-patterns.html
		canvas.width = window.innerWidth;
		canvas.height = window.innerHeight;

		vpDimensions = [canvas.clientWidth, canvas.clientHeight];
		gl.viewport(0, 0, gl.drawingBufferWidth, gl.drawingBufferHeight);

		mat4.perspective(matProj_persp, glMatrix.toRadian(45), canvas.clientWidth / canvas.clientHeight, 0.1, 1000.0);
		gl.uniformMatrix4fv(matProjUniformLocation, gl.FALSE, matProj_persp);

		//mat4.identity(mvpMatrix);
		//mat4.mul(mvpMatrix, projMatrix, viewMatrix, worldMatrix);
		
		//gl.uniformMatrix4fv(mvpUniformLocation, gl.FALSE, mvpMatrix);

		//gl.uniform1i(resXUniformLocation, canvas.clientWidth);
		//gl.uniform1i(resYUniformLocation, canvas.clientHeight);
	}

	function unproject(x, y) {

		var matInverseMVP = new Float32Array(16);
		var matMVP = new Float32Array(16);
		var inNear = vec4.create();
		var inFar = vec4.create();
		
		var xVal = x/canvas.width;
		var yVal = y/canvas.height;
		var rect = canvas.getBoundingClientRect();
		//console.log("height: " + canvas.height + ", clientHeight: " + rect.top + ", offsetTop: " + canvas.offsetTop);
		//console.log("y: " + y + ", maxY: " + canvas.height + ", yVal: " + yVal);

		vec4.set(inNear, (xVal)*2.0 - 1, (yVal)*-2.0 + 1, 0, 1.0);
		vec4.set(inFar, (xVal)*2.0 - 1, (yVal)*-2.0 + 1, 1, 1.0);

		mat4.identity(matMVP);
		mat4.mul(matMVP, matProj_ortho, matView_ortho);
		mat4.invert(matInverseMVP, matMVP);

		vec4.transformMat4(inNear, inNear, matInverseMVP);
		vec3.set(vecRayP0, inNear[0] * 1/inNear[3], inNear[1] * 1/inNear[3], inNear[2] * 1/inNear[3]);
		vec4.transformMat4(inFar, inFar, matInverseMVP);
		vec3.set(vecRayP1, inFar[0] * (1/inFar[3]), inFar[1] * (1/inFar[3]), inFar[2] * (1/inFar[3]));

		uiX = -vecRayP0[2] * (vecRayP1[0] - vecRayP0[0])/(vecRayP1[2] - vecRayP0[2]) + vecRayP0[0];
		uiY = -vecRayP0[2] * (vecRayP1[1] - vecRayP0[1])/(vecRayP1[2] - vecRayP0[2]) + vecRayP0[1];

		vec4.set(inNear, (xVal)*2.0 - 1, (yVal)*-2.0 + 1, 0, 1.0);
		vec4.set(inFar, (xVal)*2.0 - 1, (yVal)*-2.0 + 1, 1, 1.0);

		mat4.identity(matMVP);
		mat4.mul(matMVP, matProj_persp, matView_persp);
		mat4.invert(matInverseMVP, matMVP);

		vec4.transformMat4(inNear, inNear, matInverseMVP);
		vec3.set(vecRayP0, inNear[0] * 1/inNear[3], inNear[1] * 1/inNear[3], inNear[2] * 1/inNear[3]);
		vec4.transformMat4(inFar, inFar, matInverseMVP);
		vec3.set(vecRayP1, inFar[0] * (1/inFar[3]), inFar[1] * (1/inFar[3]), inFar[2] * (1/inFar[3]));
		
	}

	function canFit() {
		return true;
	}
	function OnMouseMove(e) {

		var newX = e.screenX;
		var newY = e.screenY;

		//console.log(e);
		//console.log('mousePos: ' + e.screenX + ', ' + e.screenY);
		unproject(e.offsetX, e.offsetY);

		if (e.buttons == 1) {
			// drag
			if (selCell != null){
				//(x–x1)/(x2–x1)  = (y–y1)/(y2–y1) = (z–z1)/(z2–z1)
				//at z = 0 we have (x–x1)/(x2–x1)  = (y–y1)/(y2–y1) = –z1/(z2–z1)
				//x = -z1 * (x2-x1)/(z2-z1) + x1
				//y = -z1 * (y2-y1)/(z2-z1) + y1
				newPosX = -vecRayP0[1] * (vecRayP1[0] - vecRayP0[0])/(vecRayP1[1] - vecRayP0[1]) + vecRayP0[0];
				newPosZ = -vecRayP0[1] * (vecRayP1[2] - vecRayP0[2])/(vecRayP1[1] - vecRayP0[1]) + vecRayP0[2];
				if (canFit()) {
					vec3.set(selCell.pos, newPosX, 0, newPosZ);
					var cellInfoElement = document.getElementById("cellInfo");
					cellInfoElement.innerHTML = "Pos: " + selCell.pos;
					socket.emit('plantChange', plants);
				}
			}
		    
		} else {
			// hover select
			selCell = null;
			for (var i = 0; i < plants.length; i++) {
				plants[i].hover = 0;
				plants[i].clrScalar = 0.7;
				//hover select:
				if (intersectRaySphere(i)) {
					selCell = plants[i];
				}
			}
			if (selCell != null) {
				selCell.hover = 1;
				selCell.clrScalar = 1.5;
				var cellInfoElement = document.getElementById("cellInfo");
				cellInfoElement.innerHTML = "Pos: " + selCell.pos;
			}
		}

		lastMouseX = newX
		lastMouseY = newY;
	}

	function OnClick(e) {
		for (var i = 0; i < plants.length; i++) {
			
			if ( plants[i].uiHover == 1) {
				plants[i].active = !plants[i].active;
				socket.emit('plantChange', plants);
			}
		}
		selCell = null;
	}

	function OnKeyPress(e) {
		
		if (e.key == "w" || e.key == "w") {
			var rotMatrix = mat4.create();
			var rotAngleY = 0.1;
			mat4.rotateX(rotMatrix, rotMatrix, rotAngleY);
			mat4.mul(matView_persp, matView_persp, rotMatrix);
		} else if (e.key == "s" || e.key == "S") {
			var rotMatrix = mat4.create();
			var rotAngleY = -0.1;
			mat4.rotateX(rotMatrix, rotMatrix, rotAngleY);
			mat4.mul(matView_persp, matView_persp, rotMatrix);
		} else if (e.key == "a" || e.key == "A") {
			var rotMatrix = mat4.create();
			var rotAngleX = -0.1;
			mat4.rotateY(rotMatrix, rotMatrix, rotAngleX);
			mat4.mul(matView_persp, matView_persp, rotMatrix);
		} else if (e.key == "d" || e.key == "D") {
			var rotMatrix = mat4.create();
			var rotAngleX = 0.1;
			mat4.rotateY(rotMatrix, rotMatrix, rotAngleX);
			mat4.mul(matView_persp, matView_persp, rotMatrix);
		}
		
		if (e.key == "e" || e.key == "E") {
			runSimulation = !runSimulation;
		}
	}

	// Intersects ray r = p + td, |d| = 1, with sphere s and, if intersecting, 
	// returns t value of intersection and intersection point q 
	function intersectRaySphere(i) 
	{
		var sphereRadius = 1;

		var vecM = vec3.create();
		var vecRayDir = vec3.create();
		vec3.subtract(vecM, vecRayP0, plants[i].pos);
		vec3.subtract(vecRayDir, vecRayP1, vecRayP0);
		vec3.normalize(vecRayDir, vecRayDir);
		var b = vec3.dot(vecM, vecRayDir); 
		var c = vec3.dot(vecM, vecM) - sphereRadius * sphereRadius	; 

		// Exit if r’s origin outside s (c > 0) and r pointing away from s (b > 0) 
		if (c > 0.0 && b > 0.0) {
			return false; 
		}

		var discr = b*b - c; 

		// A negative discriminant corresponds to ray missing sphere 
		if (discr < 0.0) {
			return false; 
		}

		// Ray now found to intersect sphere, compute smallest t value of intersection
		t = -b - Math.sqrt(discr); 

		// If t is negative, ray started inside sphere so clamp t to zero 
		if (t < 0.0) {
			t = 0.0;
		}
		//var q = p + t * d; 
		return true;
	}
